// ==UserScript==
// @name		Disable HTML5 Video Autoplay
// @description		All HTML5 videos autoplay, autobuffer, preload will be disabled
// @homepageURL         http://userscripts.org/scripts/show/149647
// @updateURL           https://userscripts.org/scripts/source/149647.meta.js
// @downloadURL         https://userscripts.org/scripts/source/149647.user.js
// @Author		Gela Mekoshkishvili
// @created             29-AUG-2013
// @include		http://*
// @include		https://*
// @license		GPL
// @version             1.1.0
// @icon                data:image/png;base64,

// ==/UserScript==

(function() {
	var autoplay, autobuffer, preload;
	autoplay = document.getElementsByTagName('video');
	if(autoplay) {
		for(i = 0; i < autoplay.length; i++) {
			autoplay[i].removeAttribute('autoplay');			
		}
	autobuffer = document.getElementsByTagName('video');
	if(autobuffer) {
		for(i = 0; i < autobuffer.length; i++) {
			autobuffer[i].removeAttribute('autobuffer');
		}
	preload = document.getElementsByTagName('video');
	if(preload) {
		for(i = 0; i < preload.length; i++) {
			preload[i].removeAttribute('preload');
			}
		}
	}
}

})();